import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css';

const App = () => {
  const [recipes, setRecipes] = useState([]);
  const [newRecipe, setNewRecipe] = useState({ title: '', ingredients: '', steps: '' });
  const [searchQuery, setSearchQuery] = useState('');
  const [searchedRecipe, setSearchedRecipe] = useState(null);
  const [message, setMessage] = useState('');

  const fetchRecipes = async () => {
    try {
      const res = await axios.get('http://localhost:5050/api/recipes');
      setRecipes(res.data);
    } catch (err) {
      console.error('Error fetching recipes:', err);
      setMessage('Error fetching recipes');
    }
  };

  const handleAddRecipe = async (e) => {
    e.preventDefault();
    try {
      const res = await axios.post('http://localhost:5050/api/recipes', newRecipe);
      setMessage(res.data.msg);
      setNewRecipe({ title: '', ingredients: '', steps: '' });
      fetchRecipes();
    } catch (err) {
      console.error('Error adding recipe:', err);
      setMessage('Error adding recipe');
    }
  };

  const handleSearch = async (e) => {
    e.preventDefault();
    try {
      const res = await axios.post('http://localhost:5050/get-recipe', { query: searchQuery });
      setSearchedRecipe(res.data.recipe || { title: 'Not found', ingredients: '-', steps: '-' });
    } catch (err) {
      console.error('Error searching recipe:', err);
      setSearchedRecipe({ title: 'Error occurred', ingredients: '-', steps: '-' });
    }
  };

  useEffect(() => {
    fetchRecipes();
  }, []);

  return (
    <div className="container">
      <h1>üç≤ Cooking Recipe Chatbot</h1>

      <form className="add-form" onSubmit={handleAddRecipe}>
        <h2>‚ûï Add New Recipe</h2>
        <input type="text" placeholder="Title" value={newRecipe.title} onChange={(e) => setNewRecipe({ ...newRecipe, title: e.target.value })} />
        <textarea placeholder="Ingredients" value={newRecipe.ingredients} onChange={(e) => setNewRecipe({ ...newRecipe, ingredients: e.target.value })}></textarea>
        <textarea placeholder="Steps" value={newRecipe.steps} onChange={(e) => setNewRecipe({ ...newRecipe, steps: e.target.value })}></textarea>
        <button type="submit">Add Recipe</button>
      </form>

      <form className="search-form" onSubmit={handleSearch}>
        <h2>üîç Search Recipe</h2>
        <input type="text" placeholder="Search by title..." value={searchQuery} onChange={(e) => setSearchQuery(e.target.value)} />
        <button type="submit">Search</button>
      </form>

      {searchedRecipe && (
        <div className="search-result">
          <h3>{searchedRecipe.title}</h3>
          <p><strong>Ingredients:</strong> {searchedRecipe.ingredients}</p>
          <p><strong>Steps:</strong> {searchedRecipe.steps}</p>
        </div>
      )}

      {message && <p className="message">{message}</p>}

      <h2>üìã All Recipes</h2>
      <ul className="recipe-list">
        {recipes.map((r, idx) => (
          <li key={idx}>
            <strong>{r.title}</strong><br />
            <em>Ingredients:</em> {r.ingredients}<br />
            <em>Steps:</em> {r.steps}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default App;
